INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (1, 2, "カリン", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 3.414, -416.5, 1, 0.0, "2025/01/31 12:00:00", 190801, "2030/01/01 14:59:59", 1000001, 62, 1);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (1, 2, "カリン", "ミッションをクリアして、\n報酬をゲットしましょう！", 3.099, -416.5, 1, 0.0, "2025/01/31 12:00:00", 190801, "2030/01/01 14:59:59", 1000002, 62, 2);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (1, 2, "カリン", "受け取ることができる\n報酬があるようです\n確認してみてください", 2.801, -416.5, 1, 0.0, "2025/01/31 12:00:00", 190801, "2030/01/01 14:59:59", 1000003, 63, 3);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (1, 2, "カリン", "報酬がもらえますよ！\nチェックしてみてください", 0.0, -416.5, 2, 0.0, "2025/01/31 12:00:00", 190801, "2030/01/01 14:59:59", 1000004, 63, 4);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (1, 1, "カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 2.12, -363.0, 2, 0.0, "2025/01/31 12:00:00", 190801, "2030/01/01 14:59:59", 1000005, 64, 5);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (1, 2, "カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1.68, -363.0, 1, 0.0, "2025/01/31 12:00:00", 190801, "2030/01/01 14:59:59", 1000006, 64, 6);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (1, 1, "カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 2.33, -363.0, 2, 0.0, "2025/01/31 12:00:00", 190801, "2030/01/01 14:59:59", 1000007, 64, 7);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (10201, 7, "ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 5.18, -285.0, 3, -6.0, "2025/01/31 12:00:00", 133701, "2030/01/01 14:59:59", 1020101, 61, 101);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (10201, 2, "クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 8.77, -285.0, 1, -2.0, "2025/01/31 12:00:00", 133901, "2030/01/01 14:59:59", 1020102, 61, 201);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (10201, 1, "ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 15.5, -285.0, 6, 0.0, "2025/01/31 12:00:00", 133801, "2030/01/01 14:59:59", 1020103, 61, 301);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (10202, 5, "ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 9.061, -285.0, 2, 0.0, "2025/02/28 12:00:00", 134301, "2030/01/01 14:59:59", 1020201, 61, 101);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (10202, 2, "チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 7.699, -285.0, 1, 0.0, "2025/02/28 12:00:00", 134401, "2030/01/01 14:59:59", 1020202, 61, 201);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (10203, 2, "アオイ", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 8.595, -285.0, 1, 0.0, "2025/03/31 12:00:00", 134601, "2030/01/01 14:59:59", 1020301, 61, 101);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (10203, 2, "クローチェ", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 7.758, -285.0, 1, 0.0, "2025/03/31 12:00:00", 134501, "2030/01/01 14:59:59", 1020302, 61, 201);
